import React from 'react'

const BookRow = ({
    rowData
}) => {
    const {
        id,
        book_name,
        auth_name,
        publish_date,
        edition
    } = rowData;
    return ( <
        tr >
        <
        td > {
            id
        } < /td> <
        td > {
            book_name
        } < /td> <
        td > {
            auth_name
        } < /td> <
        td > {
            publish_date
        } < /td> <
        td > {
            edition
        } < /td> <
        td > < /td>

        <
        /tr>
    )
}
export default BookRow
